`created_by` INT(11)  NOT NULL ,
`dblink` VARCHAR(255)  NOT NULL ,
`series` VARCHAR(255)  NOT NULL ,
`model` VARCHAR(255)  NOT NULL ,
`yom` VARCHAR(255)  NOT NULL ,
`msn` VARCHAR(255)  NOT NULL ,
