`ol_a_s` VARCHAR(255)  NOT NULL ,
`lu` VARCHAR(255)  NOT NULL ,
`ad` VARCHAR(255)  NOT NULL ,
`company_logo` VARCHAR(255)  NOT NULL ,
PRIMARY KEY (`id`)
) DEFAULT COLLATE=utf8_general_ci;

